import {Link} from 'react-router-dom'
import styles from '../rotas/Router.module.css'

function Navbar(){

    return(
        <div>
            <ul>
                <Link to="/">Agendar Consulta</Link>
                <Link to="/consultas">Consultas Agendadas</Link>
            </ul>
        
        </div>
    )
}

export default Navbar
